import './Home.css';
import { Link, Route, Routes } from 'react-router-dom';
import windows from './photos/windows.jpg'

const Home = () => {
  return (
    <div className="HomeDiv">
     <h1>HOME</h1>
    <aside>
       <img src={windows}></img>
    </aside>
     <div className="MeetDavidDiv"></div>
     <div className="DavidResumeDiv"></div>
     <div className="DavidPortfolioDiv"></div>

    </div>
  );
}

export default Home;
